ial it was to conceal its presence.\n", "tooltip": "<h1>44-05-19<br> Pignataro</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.75092, 41.461]}, "properties": {"time": "2044-05-20T00:00:00", "popup": "<h1>44-05-20<br> Pontecorvo</h1>1st Canadian Div Attacking the Hitler Line. Progress slower than expected. 5th Armoured Division was ordered forward and told to make ready to take over the attack. That night, the 8th New Brunswick Hussars set off toward the cyclone. By dawn on May 19, they reached \u201cOxford Bridge,\u201d south of the German strongpoint town of Sant\u2019Angelo in Teodice. Daylight found them in the middle of a lunar landscape, under the eye of the dreaded ruins atop Monte Cassino.\n", "tooltip": "<h1>44-05-20<br> Pontecorvo</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.75092, 41.461]}, "properties": {"time": "2044-05-21T00:00:00", "popup": "<h1>44-05-21<br> Pontecorvo</h1>1st Canadian Div Attacking the Hitler Line. Progress slower than expected. 5th Armoured Division was ordered forward and told to make ready to take over the attack. That night, the 8th New Brunswick Hussars set off toward the cyclone. By dawn on May 19, they reached \u201cOxford Bridge,\u201d south of the German strongpoint town of Sant\u2019Angelo in Teodice. Daylight found them in the middle of a lunar landscape, under the eye of the dreaded ruins atop Monte Cassino.\n", "tooltip": "<h1>44-05-21<br> Pontecorvo</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.75092, 41.461]}, "properties": {"time": "2044-05-22T00:00:00", "popup": "<h1>44-05-22<br> Pontecorvo</h1>1st Canadian Div Attacking the Hitler Line. Progress slower than expected. 5th Armoured Division was ordered forward and told to make ready to take over the attack. That night, the 8th New Brunswick Hussars set off toward the cyclone. By dawn on May 19, they reached \u201cOxford Bridge,\u201d south of the German strongpoint town of Sant\u2019Angelo in Teodice. Daylight found them in the middle of a lunar landscape, under the eye of the dreaded ruins atop Monte Cassino.\n", "tooltip": "<h1>44-05-22<br> Pontecorvo</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.75092, 41.461]}, "properties": {"time": "2044-05-23T00:00:00", "popup": "<h1>44-05-23<br> Pontecorvo</h1>1st Canadian Div Attacking the Hitler Line. Progress slower than expected. 5th Armoured Division was ordered forward and told to make ready to take over the attack. That night, the 8th New Brunswick Hussars set off toward the cyclone. By dawn on May 19, they reached \u201cOxford Bridge,\u201d south of the German strongpoint town of Sant\u2019Angelo in Teodice. Daylight found them in the middle of a lunar landscape, under the eye of the dreaded ruins atop Monte Cassino.\n", "tooltip": "<h1>44-05-23<br> Pontecorvo</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.6574, 41.48239]}, "properties": {"time": "2044-05-24T00:00:00", "popup": "<h1>44-05-24<br> Pontecorvo</h1>The 8th Hussars formed the third and largest task force, together with most of the Westminster Regiment, an engineer squadron, a field ambulance section, a battery of anti-tank guns, and two batteries of self-propelled \u201cPriest\u201d 105mm guns from the 8th Field Regiment. The mission of this all-arms force was to reinforce the Strathconas at the river and guarantee Canadian ownership of the Melfa crossing.\n\n", "tooltip": "<h1>44-05-24<br> Pontecorvo</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.62009, 41.51471]}, "properties": {"time": "2044-05-25T00:00:00", "popup": "<h1>44-05-25<br> Melfa River</h1>At 1630 hrs the regiment started to move down to the Melfa crossing at ref 683236 led by C Sqn, followed by RHQ, A and B Sqns. C Sqn went up to the west bank of the river at ref 685232 and reached the level ground at approx 1700 hrs. The infantry were ahead of the tanks here. The leading tank had only advanced a few hundred yards when they came under heavy anti-tank gun fire. The ensuing action lasted about 15 minutes and during it three tanks were knocked out.", "tooltip": "<h1>44-05-25<br> Melfa River</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.61045, 41.52278]}, "properties": {"time": "2044-05-26T00:00:00", "popup": "<h1>44-05-26<br> Ceprano</h1>BridgeHead Secured. The move began shortly after 0600 hrs along the centre line of the road 675244, 662231, 638243. The going was very hard for the tanks. The infantry were frequently held tp by fire and the tanks were frequently bogged. B Sqn met less fire than A Sqn but was held up by poor going, bridges blown etc. By noon B Sqn had reached 637252 but they ran onto mines at this point and lost two tanks. The mines were cleared with the help of the sappers and the Sqn moved on to ref 634255 where it stopped at 1430 hrs to refuel. A Sqn was halted at 648253, also in need of petrol.", "tooltip": "<h1>44-05-26<br> Ceprano</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.5276, 41.5441]}, "properties": {"time": "2044-05-27T00:00:00", "popup": "<h1>44-05-27<br> Ceprano</h1>Between 1000-1045 hrs B Sqn was very heavily shelled and several men were caught outside their tanks. Five were killed and eight wounded. B Sqn then moved to a more covered position at 606269.", "tooltip": "<h1>44-05-27<br> Ceprano</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.53255, 41.5225]}, "properties": {"time": "2044-05-28T00:00:00", "popup": "<h1>44-05-28<br> Ceprano</h1>Realignment with Brigade. The Sqns remained in the same positions all day. At 1100 hrs it was learned that the Armd Bde was to continue the advance beyond the Liri River. LdSH and BCD's were to lead and were on their way up now. 8NBH would be in reserve,", "tooltip": "<h1>44-05-28<br> Ceprano</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.41969, 41.54453]}, "properties": {"time": "2044-05-29T00:00:00", "popup": "<h1>44-05-29<br> Cecanno</h1>The regiment was ready to move across the Liri River bridge at 0500 hrs but due to heavy traffic did not cross until 0630 hrs. It was then necessary to concentrate on the side of the river as the roads forward were blocked. The regiment was ready to move across the Liri River bridge at 0500 hrs but due to heavy traffic did not cross until 0630 hrs. It was then necessary to concentrate on the side of the river as the roads forward were blocked.", "tooltip": "<h1>44-05-29<br> Cecanno</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.33656, 41.58463]}, "properties": {"time": "2044-05-30T00:00:00", "popup": "<h1>44-05-30<br> Frosinone</h1>Ready to adnvance on Frosinone. The advance began at 0430 hrs along the ads of the main road POFI-CECCANO. The going was very slow as almost every stream was an obstacle and every bridge or culvert had been blown. The advance was continued to 443312 where many mines were found on the road and verges. The Recce Tp and Engrs began clearing the mines. They were fired on by small arms fire but no-one was hit. Shortly after 1800 hrs it was thought that a gap was cleared. The tanks moved through but two of them hit mines and the regiment halted again.\nAs this was not a good place to spend the night the regiment was moved to 447315 where due to the proximity of the enemy a very tight \"tin-hat\" was made with all guns turned to fire on fixed lines and extra guards mounted.", "tooltip": "<h1>44-05-30<br> Frosinone</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.33534, 41.58643]}, "properties": {"time": "2044-05-31T00:00:00", "popup": "<h1>44-05-31<br> Frosinone</h1>During the action the regiment had destroyed considerable enemy equipment and killed or captured a considerable number of the enemy. A Sqn captured or destroyed three anti-tank guns, one half-tracked vehicle, a 105mm gun, and an 88mm anti-tank gun. B Sqn claimed one Panther tank destroyed, an SP gun damaged, one 88mm anti-tank gun knocked out and crwe captured, several MG's and ammunition dump captured or destroyed. C Sqn knocked out three 75mm anti-tank guns, one SP 75mm anti-tank gun, and captured two 75mm anti-tank guns. Three French-made carriers were also captured by the regiment.\nCasualties suffered by the regiment from 24-31 May were five officers wounded, ten other ranks killed and 19 wounded. Six of the tanks were destroyed and 13 tmpor temporarily put out of action.", "tooltip": "<h1>44-05-31<br> Frosinone</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.33534, 41.58643]}, "properties": {"time": "2044-06-01T00:00:00", "popup": "<h1>44-06-01<br> Frosinone</h1>During the action the regiment had destroyed considerable enemy equipment and killed or captured a considerable number of the enemy. A Sqn captured or destroyed three anti-tank guns, one half-tracked vehicle, a 105mm gun, and an 88mm anti-tank gun. B Sqn claimed one Panther tank destroyed, an SP gun damaged, one 88mm anti-tank gun knocked out and crwe captured, several MG's and ammunition dump captured or destroyed. C Sqn knocked out three 75mm anti-tank guns, one SP 75mm anti-tank gun, and captured two 75mm anti-tank guns. Three French-made carriers were also captured by the regiment.\nCasualties suffered by the regiment from 24-31 May were five officers wounded, ten other ranks killed and 19 wounded. Six of the tanks were destroyed and 13 tmpor temporarily put out of action.", "tooltip": "<h1>44-06-01<br> Frosinone</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [13.14625, 41.5492]}, "properties": {"time": "2044-06-02T00:00:00", "popup": "<h1>44-06-02<br> Pofi</h1>Rest Area. The tanks began to move to the POFI area at 0530 hrs in the order RHQ, A,B and C Sqns; A-1 Ech followed. The move was very slow due to the heavy traffic on the road and the new area ref xxxxx 2 and went on ahead of the convoy joining it at the new harbour at 1600 hrs. He left for Main Div HQ and later the COs of the 8NBH and the BCD went forward and joined the Brig at an OP from which they could view the battlefield.", "tooltip": "<h1>44-09-23<br> Gaiofana</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [12.46753, 44.06279]}, "properties": {"time": "2044-09-24T00:00:00", "popup": "<h1>44-09-24<br> Rimini</h1> At 0630 hrs the regiment started and by 1000 hrs were concentrated at ref 773982. A1 Echelon moved also and harboured about 300 yds to the east of RHQ. There was intermittent shelling throughout the afternoon and A1 Echelon suffered one casualty. By 1800 hrs there was no indication of a further move and everyone settled down to spend the night.", "tooltip": "<h1>44-09-24<br> Rimini</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [12.46753, 44.06279]}, "properties": {"time": "2044-09-25T00:00:00", "popup": "<h1>44-09-25<br> Rimini</h1> At 0630 hrs the regiment started and by 1000 hrs were concentrated at ref 773982. A1 Echelon moved also and harboured about 300 yds to the east of RHQ. There was intermittent shelling throughout the afternoon and A1 Echelon suffered one casualty. By 1800 hrs there was no indication of a further move and everyone settled down to spend the night.", "tooltip": "<h1>44-09-25<br> Rimini</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [12.46753, 44.06279]}, "properties": {"time": "2044-09-26T00:00:00", "popup": "<h1>44-09-26<br> Rimini</h1> At 0630 hrs the regiment started and by 1000 hrs were concentrated at ref 773982. A1 Echelon moved also and harboured about 300 yds to the east of RHQ. There was intermittent shelling throughout the afternoon and A1 Echelon suffered one casualty. By 1800 hrs there was no indication of a further move and everyone settled down to spend the night.", "tooltip": "<h1>44-09-26<br> Rimini</h1>"}}, {"type": "Feature", "ge in column moved off on the second lap of their journey at 0700 hrs. The move went very well today the head of the column arrived at the staging area and parked for the night by 1530 hrs. At 1700 hrs the Div Comd Major-General B.M. Hoffmeister, CBE, DSO, ED paid an informal visit to the staging area. He departed at 1730 hrs. Lt-col J.W. Eaton issued orders that the convoy would move off in the morning in blocks of 25 vehicles, at 20 minute intervals.", "tooltip": "<h1>45-02-12<br> Foligno</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [11.452557, 43.781681]}, "properties": {"time": "2045-02-13T00:00:00", "popup": "<h1>45-02-13<br> Pontassieve</h1>The route today is Highway 67 to LITVORNO. The advance party left at 0600 hrs for the next staging area. The first block of vehicles moved off on their third lap of the journey at 0700 hrs.\u00a0", "tooltip": "<h1>45-02-13<br> Pontassieve</h1>"}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [10.350061, 43.672365]}, "properties": {"time": "2045-02-14T00:00:00", "popup": "<h1>45-02-14<br> Harrods Staging Area, Pisa</h1>All personnel of the regt in No. 1 Camp are busy today cleaning and maintaining their vehicles after the move. The vehicles covered approx 400 miles since leaving CERVIA.\u00a0At 1000 hrs the vehicles of the attached personnel (PR Group and 7 Cdn Lt Fd Amb) moved off to the docks. At 1600  19 Feb, hrs 8 officers and 108 ORs left for LEGHORN. The remainder of the regts tanks loaded today, 19 tanks on LST 74 and 20 tanks on LST 210.", "tooltip": "<h1>45-02-14<br> Harrods Staging Area, Pisa</h1>"}}]}, {
